"original": |2-
     o  For the second URI, 'ipp://printer.example.com/ipp/print/
        restricted-use-printer', the value 'none' in
        "uri-security-supported" indicates that there is no secure channel
        protocol configured to run under HTTP.  The value of 'digest' in
        "uri-authentication-supported" indicates that the Printer will
        issue a challenge and that the Printer will use the name supplied
        by the Digest mechanism to determine the authenticated user (see
        Section 9.3).
"fixed": |-
  -  For the second URI, 'ipp://printer.example.com/ipp/print/ restricted-use-printer', the value 'none' in "uri-security-supported" indicates that there is no secure channel protocol configured to run under HTTP.  The value of 'digest' in "uri-authentication-supported" indicates that the Printer will issue a challenge and that the Printer will use the name supplied by the Digest mechanism to determine the authenticated user (see Section 9.3).
"ko": |-
  - 두 번째 URI 'ipp://printer.example.com/ipp/print/restricted-use-printer'의 경우 "uri-security-supported"의 'none' 값은 구성된 보안 채널 프로토콜이 없음을 나타냅니다. HTTP에서 실행합니다. "uri-authentication-supported"의 'digest' 값은 프린터가 챌린지를 발행하고 프린터가 다이제스트 메커니즘에서 제공한 이름을 사용하여 인증된 사용자를 결정함을 나타냅니다(섹션 9.3 참조).
